import React from "react";

import styles from "./NavBar.module.css";

const NavBar = () => {
  return (
    <header className={styles.navbar}>
      <nav>
        <ul>
          <li>
            <a href="/page-one">Page One</a>
          </li>
          <li>
            <a href="/page-two">Page Two</a>
          </li>

          <li>
            <a href="/page-three">Page Three</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default NavBar;
